import { Box, Button, Grid, Typography } from "@mui/material";
import React from "react";
import logo from "../images/logo.png";

const commonButtonStyles = {
  backgroundColor: "purple",
};

const Header = () => {
  return (
    <Grid container sx={{ background: "pink", padding: 2, alignItems:"center"}}>
      <Grid item xs={12} md={3}>
      <Box sx={{ display: "flex", alignItems: "center", gap: 1 }}>
          <img src={logo} alt="Logo" style={{ height: "50px", width: "60px" }} />
          <Typography variant="h3" sx={{border:'black 2px solid', }}>THE WORLD</Typography>
        </Box>
      </Grid>
      <Grid
        item
        xs={12}
        md={9}
      >
        <Box sx={{display:"flex", justifyContent:"flex-end", gap:7}}>
            <Button sx={{ backgroundColor: "white" }}>
              Home
            </Button>
            <Button sx={{ backgroundColor: "white" }}>
              About us
            </Button>
            <Button sx={{ backgroundColor: "white" }}>
              Contact us
            </Button>
        </Box>
      </Grid>
    </Grid>
  );
};

export default Header;
